import { Route, Navigate } from 'react-router-dom';

function PrivateRoute({ element: Element, isLoggedIn, ...rest }) {
  return (
    <Route {...rest}>
      {isLoggedIn ? <Element /> : <Navigate to="/Login" />}
    </Route>
  );
}

export default PrivateRoute;
